import React, { forwardRef } from "react";
import "./Box.css";
import { motion } from "framer-motion/dist/framer-motion";

const Box = forwardRef(({ value, onClick }, ref, name) => (
  <motion.div className="box">{name}</motion.div>
));

export default Box;
